import React, { Component,useState,useEffect } from 'react';
export const Stufflistcontext=React.createContext();
const StufflistcontextProvider=(props)=>{
    const [gol, setgol] = useState(['گل لاله','گل نرگس','گل مریم']);
    const [stufflidt,setStufflidt]=useState(gol);
    const changestufflidt=(x)=>{
      setStufflidt(x)
    }

return(
    <Stufflistcontext.Provider value={{stufflidt,}}>
      {props.children}
    </Stufflistcontext.Provider>
)
}
export default StufflistcontextProvider;
